import React, { Component } from "react";
export default class Porfolio extends Component {
  render() {
    let resumeData = this.props.resumeData;

    function handleClick(e) {
      e.preventDefault();
      console.log("The link was clicked.");
    }
    const projectDropdown = () => {
      console.log("iwas clicked");
    };

    return (
      <section id="portfolio">
        <h1>Check Out Some of My Projects!</h1>
        <div className="portfolio__button__layout">
          <button onClick={handleClick}>Javascript</button>
          <button onClick={projectDropdown}>CSS & HTML</button>
          <button onClick={projectDropdown}>React</button>
          <button onClick={projectDropdown}>NodeJS</button>
          <button onClick={projectDropdown}>Ruby on Rails</button>
        </div>
        <div className="portfolioGrid">
          {resumeData.portfolio &&
            resumeData.portfolio.map(item => {
              return (
                <a
                  href={`${item.url}`}
                  rel="noopener noreferrer"
                  target="_blank"
                >
                  <div className="portfolio-item portfolioGridSquare">
                    <div className="item-wrap">
                      <img
                        src={`${item.imgurl}`}
                        alt="these are my projects"
                        className="item-img"
                      />
                      <div className="overlay">
                        <div className="portfolio-item-meta">
                          <h5>{item.name}</h5>
                          <p>{item.description}</p>
                        </div>
                      </div>
                    </div>
                  </div>
                </a>
              );
            })}
          <div id="portfolio-wrapper"></div>
        </div>
      </section>
    );
  }
}
